(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0b32cb"],{"26f7":function(a){a.exports=JSON.parse('{"title":"Someone Needs a Bar","header":"As Zoya is too good with words, you had no choice but to agree to her request. Although Zoya didn\'t intend for things to go this far, she still got what she wanted...","chat":[{"chat":[{"char":"Zoya:","dialogue":"Hey! You! Say something!"},{"char":"Navigator:","dialogue":"Me? Say something? But you called me here."},{"char":"Zoya:","dialogue":"Yeah, I did, violent maniac."},{"char":"Navigator:","dialogue":"V-violent maniac?"},{"char":"Zoya:","dialogue":"Didn\'t you trample Dove underfoot and force her to work overtime?"},{"char":"Zoya:","dialogue":"Exactly what kind of violence did you inflict on Dove to have even someone like her at your beck and call?"},{"char":"Navigator:","dialogue":"I... You...!"},{"char":"Zoya:","dialogue":"Cat\'s got your tongue?"},{"char":"Zoya:","dialogue":"As I expected, the truth is irrefutable."},{"char":"Navigator:","dialogue":"I-I fell on her by accident because I fainted! I didn\'t make her work overtime!"},{"char":"Zoya:","dialogue":"Oh, so now you\'re trying to cover your true violent nature with lies, aren\'t you?"},{"char":"Zoya:","dialogue":"You can\'t replace truth with lies. You\'ll just need more lies to explain the lies."},{"char":"Zoya:","dialogue":"Looks like you\'re not only violent, but also a liar."},{"char":"Navigator:","dialogue":"What? Hey! Isn\'t your verbal attack the strongest violence, you slick young lady?"},{"char":"Navigator:","dialogue":"Don\'t you remember scolding Dove so hard after the last battle that she cried?"},{"char":"Zoya:","dialogue":"It was just reasonable motivational speech. If talking does the work, there\'s no need to get physical."},{"char":"Navigator:","dialogue":"Alright, alright, Zoya. Let\'s just drop this."},{"char":"Navigator:","dialogue":"It was pretty critical at the lounge last time. You know we were surrounded by Eclipsites back then..."},{"char":"Navigator:","dialogue":"It was critical."},{"char":"Zoya:","dialogue":"That\'s true. I\'ll take it as you admitting it."},{"char":"Zoya:","dialogue":"That lounge really helped a lot though. Many of the soldiers still miss that 10-minute break..."},{"char":"Navigator:","dialogue":"(Phew, finally got off that subject...)"},{"char":"Zoya:","dialogue":"I wonder if there are any other rooms on the Colossus."},{"char":"Navigator:","dialogue":"Huh? Other rooms? What a surprising leap of thought..."},{"char":"Zoya:","dialogue":"Is that a yes or no?"},{"char":"Zoya:","dialogue":"You\'ve stayed here for 17 years, and you can\'t even answer this?"},{"char":"Zoya:","dialogue":"What exactly have you been doing these 17 years? Just sleeping them away?..."},{"char":"Navigator:","dialogue":"Well, I actually am unsure about this."},{"char":"Navigator:","dialogue":"The Colossus was activated not too long ago. There are still a lot of new functions I haven\'t discovered yet."},{"char":"Zoya:","dialogue":"Oh, then you know less than I do."},{"char":"Navigator:","dialogue":"Less than you do?"},{"char":"Zoya:","dialogue":"I\'m a genius scientist in Gannon City. It takes only one glance for me to understand this Colossus stuff."},{"char":"Zoya:","dialogue":"There\'s at least one more room similar to the lounge!"},{"char":"Navigator:","dialogue":"Hey! How do you know that? Not even I do."},{"char":"Zoya:","dialogue":"Unlike you, I don\'t just hang around Vice all day long. I observe!"},{"char":"Zoya:","dialogue":"I\'ve observed the composition of the lounge, then spent days watching Lumina traffic in the Lumina Grid."},{"char":"Zoya:","dialogue":"You see, the thing is, you may not see any tubes or pipes in the Colossus, but I figure they\'re just hidden."},{"char":"Zoya:","dialogue":"And similar to the hydraulic machinery I studied in, this one probably has universal joints..."},{"char":"Navigator:","dialogue":"Fine, fine, I see how you discovered it now."},{"char":"Navigator:","dialogue":"Tell me. Where is it?"},{"char":"Zoya:","dialogue":"Come. It\'s right here."},{"char":"Navigator:","dialogue":"This place? Kinda outlying."},{"char":"Zoya:","dialogue":"Hmm, looks like you seldom come here. You must have been staying at the bridge all the time."},{"char":"Navigator:","dialogue":"So, what do you think this place is? Another lounge?"},{"char":"Zoya:","dialogue":"Hmm, pretty sure it\'s not a reading room. Try building it."},{"char":"Navigator:","dialogue":"Try building it? Easy for you to say!"},{"char":"Zoya:","dialogue":"I thought you can use that psychic ability or something to sense the Colossus! Why can\'t you be more flexible? Just ask it!"},{"char":"Zoya:","dialogue":"Sigh. All you got is just this psychic ability."},{"char":"Zoya:","dialogue":"If not for that, you probably wouldn\'t even be able to graduate from elementary school in Illumina Federation..."},{"char":"Navigator:","dialogue":"I!"},{"char":"Zoya:","dialogue":"Just give it a shot."},{"char":"Navigator:","dialogue":"Attempting to sense..."},{"char":"Zoya:","dialogue":"Oh, not bad for a Colossus homebody."},{"char":"Navigator:","dialogue":"Except... this doesn\'t look like somewhere people could rest."},{"char":"Navigator:","dialogue":"This table, this bottle, this weird device, and that round box..."},{"char":"Zoya:","dialogue":"Those are a bar, a bottle of wine, a CD player, and a drum. Look, I\'ll play the drum for you."},{"char":"Navigator:","dialogue":"Okay! Enough! Everyone on the Colossus can hear it!"},{"char":"Zoya:","dialogue":"No, no one can. According to my observation, this room is completely soundproofed. Just step outside and you\'ll see."},{"char":"Navigator:","dialogue":"You\'re right. I can\'t hear anything."},{"char":"Zoya:","dialogue":"So this is really a good place for people to drink, chat, and waste their lives away."},{"char":"Navigator:","dialogue":"Well, Zoya... Are you kind of..."},{"char":"Zoya:","dialogue":"Kind of what?"},{"char":"Navigator:","dialogue":"Um, disappointed?"},{"char":"Zoya:","dialogue":"Not really. After all, this place has its value."},{"char":"Zoya:","dialogue":"There are a lot of loafers who enjoy wasting their lives away and damaging their bodies with all kinds of stuff."},{"char":"Zoya:","dialogue":"Only to show off their so-called manliness or femininity."},{"char":"Zoya:","dialogue":"I guess it\'s for the best. Just let those loafers gather here instead."},{"char":"Zoya:","dialogue":"That way I won\'t be disturbed by those drunkards when I read."},{"char":"Navigator:","dialogue":"I see."},{"char":"Zoya:","dialogue":"By the way, Colossus homebody, a task for you."},{"char":"Navigator:","dialogue":"What task? Oh, and please stop calling me a Colossus homebody!"},{"char":"Zoya:","dialogue":"Well, Navigator then."},{"char":"Zoya:","dialogue":"Get all of them alcoholics to come here to keep them from wandering about in the Colossus."},{"char":"Zoya:","dialogue":"If Commander Hiiro knows I\'ve been to this kind of place..."},{"char":"Zoya:","dialogue":"Oh dear, I shudder to think."},{"char":"Navigator:","dialogue":"Commander Hiiro?"},{"char":"Zoya:","dialogue":"Yeah, the beautiful, cool, and stunning Commander Hiiro!"},{"char":"Zoya:","dialogue":"She might misunderstand if she knew I\'ve been to this kind of place and spent time with someone like you..."},{"char":"Zoya:","dialogue":"Boo-hoo. Zoya is yours forever, Commander Hiiro."},{"char":"Navigator:","dialogue":"Ahem."},{"char":"Zoya:","dialogue":"You know, I should probably take action... to win Commander Hiiro\'s..."},{"char":"Navigator:","dialogue":"(Zoya\'s lost in her thought. I\'d better get out of here before it\'s too late. Go.)"}],"branch":[]}]}')}}]);
